import React from "react";
import { useGlobalContext } from "./context";

const Moives = () => {
     const { movie } = useGlobalContext();
     return (
          <>
               {movie.map((curMovie) => {
                    return (
                         <div>
                              <h2>{curMovie.Title}</h2>
                         </div>
                    );
               })}
          </>
     );
};

export default Moives;
